import React from "react";

import { Box, Container, Grid, List } from "@mui/material";
import { styled } from "@mui/material";
import img from "../ asset/fod.jpeg";

const Logo = styled("img")(({ theme }) => ({
  position: "relative",
  width: "100px",
  top: "40px",

  [theme.breakpoints.down("sm")]: {
    width: "100px",
    position: "relative",
    left: "",
    top: "50px",
  },
}));

const Con = styled("div")((theme) => ({
  color: "red",
  fontSize: "40px",

  [theme.breakpoints.down("sm")]: {},
}));

function Home() {
  return (
    <>
      <Box
        sx={{
          height: "799px",
          maxWidth: "100%",
        }}
      >
        <Container>
          <Grid container>
            <Grid item xs={5} sm={6}>
              mangemene service company
            </Grid>
            <Grid item xs={2} sm={4}></Grid>
            <Grid item xs={5} sm={2}>
              condut us
            </Grid>
          </Grid>
        </Container>
      </Box>
    </>
  );
}

export default Home;
